import { Text, Center, Flex } from "@chakra-ui/react";

export default function Card() {
	return (
		<>
			<Center maxW="sm" borderWidth="1px" borderColor="red.400" borderRadius="lg" mx="5">
				<Flex direction="column" bg="gray.50">
					<Text mb="2" color="black">
						Title
					</Text>
					<Text mb="2" color="gray.500">
						{" "}
						Price
					</Text>
				</Flex>
			</Center>
		</>
	);
}
